import "../Login/main.css";
import "../Login/util.css";

import React, { useState } from "react";
import { useNavigate} from "react-router-dom";
function Login() {
    const navigate = useNavigate();
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");    

    function LogInClick() {
        console.log(username, password);
    }

    function RegisterClick() {
        navigate('/register');
    }
    const rules = [
        {
            required:true,
            message: 'Required'
        }
    ];
    return <div className="limiter">
    <div className="container-login100">
        <div className="wrap-login100">
            {/* <form className="login100-form validate-form p-l-55 p-r-55 p-t-178"> */}
                <span className="login100-form-title">
                    Login
                </span>

                <div className="wrap-input100 validate-input m-b-16" data-validate="Please enter username">
                    <input rules={rules} className="input100" type="text" name="username" placeholder="Username" onChange={event => setUsername(event.target.value)} value={username} />
                    <span className="focus-input100"></span>
                </div>

                <div className="wrap-input100 validate-input" data-validate = "Please enter password">
                    <input rules={rules} className="input100" type="password" name="password" placeholder="Password" onChange={event => setPassword(event.target.value)} value={password}/>
                    <span className="focus-input100"></span>
                </div>

                {/* <div className="text-right p-t-13 p-b-23">
                    <span className="txt1">
                        Forgot
                    </span>

                    <a href="#" className="txt2">
                        Username / Password?
                    </a>
                </div> */}

                <div className="container-login100-form-btn">
                    <button className="login100-form-btn" onClick={LogInClick}>
                        Login
                    </button>
                </div>

                <div className="flex-col-c p-t-100 p-b-40">
                    <span className="txt1 p-b-9">
                        Donâ€™t have an account?
                    </span>
                    <a onClick={RegisterClick} href='/register'className="txt3" >
                        Register
                    </a>
                </div>
            {/* </form> */}
        </div>
    </div>
</div>
}

export default Login;
